(1, 'Web Development', 'beginner', 'What is the primary purpose of HTML?', 'Styling web pages', 'Structuring content', 'Programming logic', 'Database management', 'B', 'HTML (HyperText Markup Language) is used to structure content on the web, defining elements like headings, paragraphs, and links.'),
(2, 'Web Development', 'beginner', 'Which language adds interactivity to websites?', 'CSS', 'HTML', 'JavaScript', 'SQL', 'C', 'JavaScript enables dynamic features like form validation, animations, and real-time updates on web pages.'),
(3, 'Web Development', 'beginner', 'What does CSS stand for?', 'Creative Style System', 'Cascading Style Sheets', 'Computer Style Syntax', 'Content Structuring System', 'B', 'CSS (Cascading Style Sheets) is used to style and layout web pages, controlling colors, fonts, and positioning.'),
(4, 'Web Development', 'intermediate', 'Which HTML tag is used for hyperlinks?', '<link>', '<a>', '<href>', '<url>', 'B', 'The <a> tag, with the href attribute, creates clickable links to other pages or resources.'),
(5, 'IT Basics', 'beginner', 'What is an operating system?', 'A web browser', 'A database', 'Software managing hardware', 'A programming language', 'C', 'An operating system (e.g., Windows, Linux) manages computer hardware and software resources.'),
(6, 'IT Basics', 'beginner', 'Which device stores data permanently?', 'RAM', 'Hard Disk', 'CPU', 'Monitor', 'B', 'A hard disk stores data permanently, unlike RAM, which is temporary.'),
(7, 'IT Basics', 'intermediate', 'What does URL stand for?', 'Universal Resource Locator', 'Uniform Resource Link', 'Unique Reference Label', 'Unified Resource Language', 'A', 'A URL (Universal Resource Locator) is the address of a resource on the internet, like a webpage.'),
(8, 'IT Basics', 'beginner', 'What is the role of a web browser?', 'Store data', 'Display web pages', 'Edit code', 'Manage networks', 'B', 'A web browser (e.g., Chrome, Firefox) renders and displays web content to users.'),
(9, 'Graphic Design', 'beginner', 'Which tool is best for beginners to create graphics?', 'Photoshop', 'Canva', 'Illustrator', 'Blender', 'B', 'Canva is user-friendly and ideal for beginners to create posters, logos, and social media graphics.'),
(10, 'Graphic Design', 'beginner', 'What is the purpose of a color palette?', 'Define fonts', 'Organize images', 'Choose harmonious colors', 'Create animations', 'C', 'A color palette ensures consistent and visually appealing color combinations in design.'),
(11, 'Content Writing', 'beginner', 'What is SEO in content writing?', 'Social Engagement Optimization', 'Search Engine Optimization', 'Structured Editing Option', 'Systematic Error Output', 'B', 'SEO (Search Engine Optimization) improves content visibility on search engines like Google.'),
(12, 'Content Writing', 'beginner', 'Which is key for engaging content?', 'Complex jargon', 'Clear language', 'Long paragraphs', 'No images', 'B', 'Clear, concise language makes content accessible and engaging for readers.'),
(13, 'Digital Marketing', 'beginner', 'What is the goal of social media marketing?', 'Write code', 'Increase brand awareness', 'Design hardware', 'Store data', 'B', 'Social media marketing promotes brands and engages audiences on platforms like Instagram and Twitter.'),
(14, 'Digital Marketing', 'beginner', 'Which metric tracks website visitors?', 'CPU speed', 'Page views', 'RAM usage', 'File size', 'B', 'Page views measure how many times a webpage is visited, indicating user traffic.'),
(15, 'Video Editing', 'beginner', 'Which software is used for video editing?', 'Excel', 'Premiere Pro', 'Word', 'PowerPoint', 'B', 'Adobe Premiere Pro is a professional tool for editing videos, widely used for YouTube and ads.'),
(16, 'Video Editing', 'beginner', 'What is a video transition?', 'Audio filter', 'Scene change effect', 'Text overlay', 'Color adjustment', 'B', 'A transition (e.g., fade, wipe) creates smooth visual shifts between video scenes.');

